import { React, useState,useEffect } from 'react'
import { useNavigate } from 'react-router-dom'

export default function Profile() {
  const Auth = localStorage.getItem('student')
  return (
    <div>
      <div className='userDetails'>
        <h3>Name : </h3><p>{Auth}</p>
      </div>
    </div>
  )
}
